","attributes":{"line":{"header":1}}},{"text":"Weird house with long corridors and darkness. Computer game like stuff with Monsters/enemies. Soldiers with plastic weapons, I snap one in half and tell them to stay away. 

Laundry and cleaning. Bunk beds. "}]}

{"meta":{"version":1,"small-lines-removed":true,"created":{"platform":"com.bloombuilt.dayone-ios","version":583}},"contents":[{"attributes":{"line":{"header":1}},"text":"Flight
"},{"text":"Crossing border from Russia to Canada. Flight tickets are dodgy and weird and when it comes to boarding I have to carry my own bags into the plain. I have loads of bags including some of my dads camera gear. 

We then start flying with David Attenborough a pilot. He drops weird pink smoke bombs into lakes. "}]}

{"contents":[{"attributes":{"line":{"header":1}},"text":"Jannie and Queen
"},{"text":"Being somewhere with Jannie and wanting to go shopping. 

In Queens private chambers on some sort of tour and there are lots of rules. Food is served. Queen faints. Some Italien dude tries to help her but she pushes him away and just mocks him and french people. I see her on the floor again and she is cold and I hold her head so I hug her and she says kiss me. I kiss her but a servant sees and she orders her death. "}],"meta":{"version":1,"small-lines-removed":true,"created":{"platform":"com.bloombuilt.dayone-ios","version":610}}}

{"meta":{"version":1,"small-lines-removed":true,"created":{"version":628,"platform":"com.bloombuilt.dayone-ios"}},"contents":[{"text":"Schweigi
","attributes":{"line":{"header":1}}},{"text":"In big pool with lots of people. He looks at me from the crowd. We dive under water to get closer and try and kiss. 

Computer game like bit where I find a secret box with jewellery in it and we have to find the way through and shoot ‚Äúmonsters‚Äù. "}]}

{"meta":{"version":1,"small-lines-removed":true,"created":{"platform":"com.bloombuilt.dayone-ios","version":637}},"contents":[{"text":"Glastonbury 
","attributes":{"line":{"header":1}}},{"text":"First day, walking around trying to orient myself. Lots of monks, like thousands, are performing some sort of ceremony to open the festival. Half of them are dressed in white, the other half in brown. 

I think I need to get the schedule somewhere. I also wonder how I got there unprepared. No bag, camera, etc. I wonder about my phone battery. "}]}

{"meta":{"version":1,"small-lines-removed":true,"created":{"platform":"com.bloombuilt.dayone-ios","version":683}},"contents":[{"attributes":{"line":{"header":1}},"text":"Head band
"},{"text":"With feathers and wires. I put it on while looking for a special kind of feather for someone else. 

"}]}

{"meta":{"version":1,"small-lines-removed":true,"created":{"platform":"com.bloombuilt.dayone-ios","version":760}},"contents":[{"attributes":{"line":{"identifier":"1F5796BA-7ADB-404E-8846-498DBDB8BE3C","header":1}},"text":"App
"},{"text":"Ski Woman talks of app that displays photos in hierarchy kinda like a story but also kinda like a map to explore. You click through and go deeper into the tree. Each step you can see a photo which she emphasised is taken with her special method - an object is photographed on a very high mountain so that the sun is right above and the light is optimal. 

I keep thinking as she talks about this app that this would be so much better as a website/webapp using grids etc. "}]}

{"meta":{"version":1,"small-lines-removed":true,"created":{"platform":"com.bloombuilt.dayone-ios","version":843}},"contents":[{"attributes":{"line":{"header":1,"identifier":"85D53A21-5334-4F14-B89A-3ED9A4AFC728"}},"text":"OED Special Edition 
"},{"text":"Queneau style all cut up and super colourful and arty. The most beautiful thing I‚Äôve ever seen and touched. There were several parts of books and this was just one but the biggest of them all. I was there with Leigh and he was really awkward. There was no price just notices that no photos are allowed so he took out a hole punch from his bag and pretended to take a picture so he could ask the lady for a leaflet. 

"}]}

{"meta":{"version":1,"small-lines-removed":true,"created":{"platform":"com.bloombuilt.dayone-ios","version":898}},"contents":[{"attributes":{"line":{"header":1,"identifier":"08648B36-45DB-41EB-A492-8CF14DD5C7FD"}},"text":"Crane
"},{"text":"Sitting in big crane when in starts to fall for some reason, down a hill no less. There are a few others too and we brace for impact but are fairly certain we will die. It takes forever. But then when we think we should have reached the bottom it somehow stops and actually slows down and one of us gets up (the others still bracing) to look out the windows (it is dark by the way). The dream then changes to TV mode and I can see outside the crane, which hovers just over the ground/water at the bottom of the mountain that we slid/crashed down. We are slowly rotating now. 

Then suddenly some strange alien appears and says ‚ÄúI will take you and sell you to another alien race.‚Äú she isn‚Äôt explicitly explaining it but I know that the alternative is to stay and die in this crash so what choice do we have?"}]}

