"},{"text":"In a House with lots of books and Italian music playing. Looking through the books, it‚Äôs all art books and stuff about theatre and opera etc. I recognise some songs and get nostalgic. 

Then suddenly I‚Äôm on rollerblades in a city without breaks. It‚Äôs busy and I try to avoid people and I try to stop. "}]}
